import React from 'react'
import { FaPlusCircle,FaSmile } from 'react-icons/fa'
function CreateAd(props){
  return(
    <div className="d-flex d-inline" style={{width:"50%",height:"100%",background:"red"}}>
    <FaPlusCircle style={{color:"rgb(0,233,233)"}} />
    </div> 
  )
}

function MyAds(props){
  return(
      <div className="d-flex d-inline" style={{width:"50%",height:"100%",background:"blue"}}>
      <FaSmile />
      </div>
  )
}
class DashBoard extends React.Component{
    constructor(props){
        super(props)
    }
    render(){
        return (
        <div className="container d-flex align-items-center" style={{height:"100vh",width:"100vw"}}>
        <div className="shadow" style={{backgroundColor:"rgb(71,64,95,0.9)",height:"90vh",width:"90vw"}}>
        <CreateAd />
        <MyAds />
        </div>
        </div>
        )
    }
}

export default DashBoard;
